import stringMethods from "../../library/stringMethods";

const SingleClientData = ({ fieldsData, client, onInputChange }: any) =>
  fieldsData.map(field => {
    switch (field.fieldType) {
      case "text":
        return (
          <div key={field.fieldName}>
            {new stringMethods(field.fieldName)
              .camelStringToText()
              .firstCharUpperCase()
              .getString()}
            <textarea name={field.fieldName} value={client[field.fieldName]} onChange={onInputChange} disabled={field.fieldName === "dateAdded"}/>
          </div>
        );
      case "number":
        return (
          <div key={field.fieldName}>
            {new stringMethods(field.fieldName)
              .camelStringToText()
              .firstCharUpperCase()
              .getString()}
            <input type="number" name={field.fieldName} value={client[field.fieldName]} onChange={onInputChange}/>
          </div>
        );
      case "select":
        return (
          <div key={field.fieldName}>
            {new stringMethods(field.fieldName)
              .camelStringToText()
              .firstCharUpperCase()
              .getString()}
            <select name={field.fieldName} value={client[field.fieldName]} onChange={onInputChange}>
                <option key="---">---</option>
              {field.fieldOptions.map(option => (
                <option key={option.id}>{option.value}</option>
              ))}
            </select>
          </div>
        );
    }
  });

export default SingleClientData;
